  >
    <path
      d="M6 2c0 1.1.9 2 2 2s2-.9 2-2-.9-2-2-2-2 .9-2 2ZM0 2c0 1.1.9 2 2 2s2-.9 2-2-.9-2-2-2-2 .9-2 2Zm12 0c0 1.1.9 2 2 2s2-.9 2-2-.9-2-2-2-2 .9-2 2Z"
      fill="#4F5E7B"
    />
  </svg>
)

export default SvgSettingsDots
